const myList = ['Головна', 'Про мене', 'Сервіси', 'Портфоліо', 'Клнтакти'];

const Header = () => {
	return (
		<div className={root}>
			<div className="logotyp">
				Web Deweloper <span>Kondratiev</span>
			</div>
			<ul className="myList">
				{myList.map((obj, i) => {
					<li key={i}>{obj[i]}</li>;
				})}
			</ul>
		</div>
	);
};

export default Header;
